import React from 'react';
import './footer.css'; // Assurez-vous d'avoir un fichier CSS correspondant pour le style

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-content">
                <div className="footer-logo">
                    <img src={require('../photos/winnercoloresvg.svg').default} alt="Logo Winner-Art" />
                </div>
                <div className="footer-contact">
                    <p>Email: contact@winner-art.com</p>
                    <p>Téléphone: +33 1 23 45 67 89</p>
                    <p>Adresse: 123 Rue de l'Exemple, 75000 Paris, France</p>
                    <p>Ville: Paris</p>
                </div>
                <div className="footer-social">
                    <a href="https://www.facebook.com/ArtsWinners" target="_blank" rel="noopener noreferrer"><img src={require('../photos/facebook.svg').default} alt="Facebook" /></a>
                    <br></br><a href="https://www.instagram.com/ecolewinnerart/" target="_blank" rel="noopener noreferrer">Instagram</a>
                    
                </div>
            </div>
        </footer>
    );
};

export default Footer;
